import React, { useState } from "react";

const SellNow = () => {
  // State variables
  const [brand, setBrand] = useState("");
  const [processor, setProcessor] = useState("");
  const [productType, setProductType] = useState("");
  const [generation, setGeneration] = useState("");
  const [touchscreen, setTouchscreen] = useState("");
  const [screen, setScreen] = useState("");
  const [graphics, setGraphics] = useState("");
  const [ram, setRAM] = useState("");
  const [hdd, setHDD] = useState("");
  const [ssd, setSSD] = useState("");

  const [file, setFile] = useState(null);

  // File upload event handler
  const handleFileUpload = (event) => {
    setFile(event.target.files[0]);
  };

  return (
    <div className="container home1 SellNow Bgg d-flex justify-content-center">
      <div className="col-6">
        {/* Laptop Brand */}
        <select
          onChange={(e) => setBrand(e.target.value)}
          className="form-select mt-3 mb-3"
          aria-label="Default select example"
          required
        >
          <option>Select Laptop Brand</option>
          {/* Options */}
        </select>

        {/* Processor Model */}
        <select
          onChange={(e) => setProcessor(e.target.value)}
          className="form-select mb-3"
          aria-label="Default select example"
          required
        >
          <option>Select Processor Model</option>
          {/* Options */}
        </select>

        {/* Processor Generation */}
        <select
          onChange={(e) => setGeneration(e.target.value)}
          className="form-select mb-3"
          aria-label="Default select example"
          required
        >
          <option>Select Processor Generation</option>
          {/* Options */}
        </select>

        {/* Product Type */}
        <select
          onChange={(e) => setProductType(e.target.value)}
          className="form-select mb-3"
          aria-label="Default select example"
          required
        >
          <option>Select Product Type</option>
          {/* Options */}
        </select>

        {/* Touchscreen */}
        <select
          onChange={(e) => setTouchscreen(e.target.value)}
          className="form-select mb-3"
          aria-label="Default select example"
          required
        >
          <option>Select Touchscreen</option>
          {/* Options */}
        </select>

        {/* Screen Size */}
        <select
          onChange={(e) => setScreen(e.target.value)}
          className="form-select mb-3"
          aria-label="Default select example"
          required
        >
          <option>Select Screen Size</option>
          {/* Options */}
        </select>

        {/* Graphics Card */}
        <select
          onChange={(e) => setGraphics(e.target.value)}
          className="form-select mb-3"
          aria-label="Default select example"
          required
        >
          <option>Graphics Card</option>
          {/* Options */}
        </select>

        {/* RAM */}
        <select
          onChange={(e) => setRAM(e.target.value)}
          className="form-select mb-3"
          aria-label="Default select example"
          required
        >
          <option>Select RAM</option>
          {/* Options */}
        </select>

        {/* HDD Capacity */}
        <select
          onChange={(e) => setHDD(e.target.value)}
          className="form-select mb-3"
          aria-label="Default select example"
        >
          <option>Select HDD Capacity</option>
          {/* Options */}
        </select>

        {/* SSD Capacity */}
        <select
          onChange={(e) => setSSD(e.target.value)}
          className="form-select mb-3"
          aria-label="Default select example"
        >
          <option>Select SSD Capacity</option>
          {/* Options */}
        </select>

        {/* File Upload */}
        <input
          type="file"
          onChange={handleFileUpload}
          className="form-control mb-3"
          required
        />

        {/* Submit Button */}
        <button type="submit" className="btn btn-primary">
          Sell Now
        </button>
      </div>
    </div>
  );
};

export default SellNow;
